// src/components/headers/AdminMenu.js
import { Link } from 'react-router-dom';

const AdminMenu = () => (
  <>
    <Link to="/admin/approvals" className="hover:text-purple-600 font-semibold">รออนุมัติ</Link>
    <Link to="/admin/companies" className="hover:text-purple-600">สถานประกอบการ</Link>
    <Link to="/admin/reports" className="hover:text-purple-600">รายงาน</Link>
    <Link to="/admin/profile" className="hover:text-purple-600">โปรไฟล์</Link>
  </>
);

export default AdminMenu;
